static void softmax(float* input, float* output, int len)
{
    float max_val = -INFINITY;
    for(int i=0; i < len; i++){
       if(input[i] > max_val)
           max_val = input[i];
    }
    float sum = 0.0f;
    for(int i=0; i < len; i++){
        output[i] = expf(input[i]-max_val);
        sum += output[i];
    }
    for(int i=0; i < len; i++)
        output[i] /= sum;
}
static float expectation(float* prob, int len)
{
    float result = 0.0f;
    for(int i=0; i < len; i++){
        result += prob[i] * (float)i;
    }
    return result;
}
static inline float clamp(float x) {
    return fminf(fmaxf(x, 0.0f), 1.0f);
}
static inline float sigmoid(float x) {
    return 1.0f / (1.0f + expf(-x));
}
static float calc_iou(float box1[4], float box2[4])
{
    // box format: [x1, y1, x2, y2]
    float x1 = fmaxf(box1[0], box2[0]);
    float y1 = fmaxf(box1[1], box2[1]);
    float x2 = fminf(box1[2], box2[2]);
    float y2 = fminf(box1[3], box2[3]);

    float inter_w = fmaxf(0.0f, x2 - x1);
    float inter_h = fmaxf(0.0f, y2 - y1);
    float inter_area = inter_w * inter_h;

    float area1 = (box1[2]-box1[0]) * (box1[3]-box1[1]);
    float area2 = (box2[2]-box2[0]) * (box2[3]-box2[1]);

    float union_area = area1 + area2 - inter_area;
    if(union_area <= 0.0f) return 0.0f;

    return inter_area / union_area;
}
#define OUT_H (4)
#define OUT_W (5)
#define OUT_C (33)
#define REG_MAX (7)
#define W (5.0f)
#define H (4.0f)
#define IOU_THRESHOLD (0.9f)
static float prob_reg[4][REG_MAX+1];

static float bbox[4];
static float pre_bbox[4];
static uint32_t max_h, max_w;

void spsf_forward(int8_t* input, int* errorcode, float* result)
{
    float max_value = -INFINITY;
    float* output;
    output = dnn_compute_spsf(input, errorcode);
    float (*output3d)[OUT_W][OUT_C] = (float (*)[OUT_W][OUT_C])output;

    // 1. 
    for(uint32_t h=0; h < OUT_H; h++){
        for(uint32_t w=0; w < OUT_W; w++){
            float value = sigmoid(output3d[h][w][0]);
            if(value > max_value){
                max_value = value;
                max_h = h;
                max_w = w;
            }
        }
    }

    // 2.  bbox
    for(uint32_t i=0; i < 4; i++){
        for(uint32_t p=0; p < REG_MAX+1; p++){
            prob_reg[i][p] = output3d[max_h][max_w][1+i*(REG_MAX+1)+p];
        }
    }
    for(uint32_t i=0; i < 4; i++){
        softmax(&prob_reg[i][0], &prob_reg[i][0], REG_MAX+1);
        bbox[i] = expectation(&prob_reg[i][0], REG_MAX+1)/REG_MAX;
    }

    float cx = ((float)max_w + 0.5f) / W;
    float cy = ((float)max_h + 0.5f) / H;
    float current_box[4] = {
        clamp(cx - bbox[0]),
        clamp(cy - bbox[1]),
        clamp(cx + bbox[2]),
        clamp(cy + bbox[3])
    };

    // 3.  IOU
    float iou = calc_iou(pre_bbox, current_box);

    if(iou < IOU_THRESHOLD){
        // 
        for(int i=0; i<4; i++) pre_bbox[i] = current_box[i];
    }
    //  IOU >=  pre_bbox 

    // 4. 
    result[0] = max_value;
    result[1] = pre_bbox[0];
    result[2] = pre_bbox[1];
    result[3] = pre_bbox[2];
    result[4] = pre_bbox[3];
}
